import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TablePagination from "@material-ui/core/TablePagination";
import TableRow from "@material-ui/core/TableRow";

const columns = [
  { id: "id_idorder", label: "ID", minWidth: 15 },
  { id: "id_buyer_name", label: "Ime", minWidth: 100 },
  { id: "id_buyer_surname", label: "Prezime", minWidth: 100 },
  { id: "id_offer_code", label: "Kod", minWidth: 15 },
  { id: "id_quantity", label: "Količina", minWidth: 1 },
  { id: "id_e_mail", label: "E-mail", minWidth: 100 },
  { id: "id_phone_no", label: "Mobitel", minWidth: 100 },
  { id: "id_comments", label: "Komentar", minWidth: 100 },
  { id: "editAppointment", label: "Uredi termin...", minWidth: 100 },
  { id: "deleteAppointment", label: "Poništi termin...", minWidth: 100 },
  { id: "setAppointment", label: "Dogovori termin...", minWidth: 100 },
  //   {
  //     id: "size",
  //     label: "Size\u00a0(km\u00b2)",
  //     minWidth: 170,
  //     align: "right",
  //     format: (value) => value.toLocaleString("hr-HR"),
  //   },
];

function createData(
  data_idorder,
  data_buyer_name,
  data_buyer_surname,
  data_offer_code,
  data_quantity,
  data_e_mail,
  data_phone_no,
  data_comments
) {
  return {
    data_idorder,
    data_buyer_name,
    data_buyer_surname,
    data_offer_code,
    data_quantity,
    data_e_mail,
    data_phone_no,
    data_comments,
  };
}

const rows = [
  createData(
    1,
    "ivan",
    "r",
    "1",
    4,
    "ivan@mail",
    "+385976289333",
    "k oment arkomen tark o me ntarko mentarkomenta rkomen tar"
  ),
  createData(
    2,
    "ivan2",
    "r2",
    "12",
    42,
    "ivan@mail2",
    "+3859762893332",
    "k oment arkomen tark o me ntarko mentarkomenta rkomen tar2"
  ),
  createData(
    3,
    "ivan3",
    "r3",
    "13",
    43,
    "ivan@mail3",
    "+3859762893333",
    "k oment arkomen tark o me ntarko mentarkomenta rkomen tar3"
  ),
  createData(
    4,
    "ivan4",
    "r4",
    "14",
    44,
    "ivan@mail4",
    "+3859762893334",
    "k oment arkomen tark o me ntarko mentarkomenta rkomen tar4"
  ),
  createData(
    5,
    "ivan5",
    "r5",
    "15",
    45,
    "ivan@mail5",
    "+3859762893335",
    "k oment arkomen tark o me ntarko mentarkomenta rkomen tar5"
  ),
  createData(
    6,
    "ivan6",
    "r6",
    "16",
    46,
    "ivan@mail6",
    "+3859762893336",
    "k oment arkomen tark o me ntarko mentarkomenta rkomen tar6"
  ),
];

const useStyles = makeStyles({
  root: {
    width: "75%",
    alignContent: "center",
  },
  container: {
    maxHeight: 440,
  },
});

export default function StickyHeadTable() {
  const classes = useStyles();
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };

  return (
    <Paper className={classes.root}>
      <TableContainer className={classes.container}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell
                  key={column.id}
                  align={column.align}
                  style={{ minWidth: column.minWidth }}
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {rows
              .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
              .map((row) => {
                return (
                  <TableRow hover role="checkbox" tabIndex={-1} key={row.code}>
                    {columns.map((column) => {
                      const value = row[column.id];
                      return (
                        <TableCell key={column.id} align={column.align}>
                          {column.format && typeof value === "number"
                            ? column.format(value)
                            : value}
                        </TableCell>
                      );
                    })}
                  </TableRow>
                );
              })}
          </TableBody>
        </Table>
      </TableContainer>

      <TablePagination
        rowsPerPageOptions={[10, 25, 100]}
        component="div"
        count={rows.length}
        rowsPerPage={rowsPerPage}
        page={page}
        onChangePage={handleChangePage}
        onChangeRowsPerPage={handleChangeRowsPerPage}
      />
    </Paper>
  );
}
